import React, { useEffect, useState } from 'react';
import { supabase } from './supabaseClient';
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, RadialBarChart, RadialBar
} from 'recharts';

function WeatherForecastPanel({ selected, onClick }) {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      const { data, error } = await supabase
        .from('weather_forecast')
        .select('*')
        .order('recorded_at', { ascending: true })
        .limit(100);
      if (!error) setData(data || []);
      setLoading(false);
    };
    fetchData();
  }, []);

  if (loading) return <div>Loading weather forecast data...</div>;
  if (!data.length) return <div>No weather forecast data available.</div>;

  // Prepare data for temperature gauge (latest value)
  const latest = data[data.length - 1];
  const tempGaugeData = [
    { name: 'Temperature', value: latest.temperature, fill: latest.temperature > 35 ? '#d32f2f' : latest.temperature < 0 ? '#1976d2' : '#ffa726' }
  ];

  return (
    <div
      onClick={onClick}
      style={{
        margin: '32px 0',
        background: selected ? 'rgba(197,225,165,0.95)' : 'rgba(255,255,255,0.9)',
        borderRadius: 16,
        boxShadow: selected
          ? '0 4px 24px 0 rgba(56,142,60,0.25)'
          : '0 2px 8px rgba(99,102,241,0.08)',
        padding: selected ? 36 : 24,
        border: selected ? '2px solid #388e3c' : '2px solid transparent',
        cursor: 'pointer',
        transition: 'all 0.2s',
      }}
    >
      <h2 style={{ color: '#1976d2', fontWeight: 700, marginBottom: 12 }}>Weather Forecast</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: 32, justifyContent: 'center' }}>
        {/* Temperature Gauge */}
        <div style={{ width: 200, height: 200, display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
          <RadialBarChart width={200} height={200} cx={100} cy={100} innerRadius={70} outerRadius={100} barSize={18} data={tempGaugeData} startAngle={180} endAngle={0} >
            <RadialBar minAngle={15} background clockWise dataKey="value" />
            <text x={100} y={110} textAnchor="middle" dominantBaseline="middle" fontSize={32} fontWeight={700} fill="#222">{latest.temperature}°C</text>
            <text x={100} y={150} textAnchor="middle" fontSize={16} fill="#1976d2">Temperature</text>
          </RadialBarChart>
        </div>
      </div>
      {/* Combined Chart for parameters */}
      <div style={{ marginTop: 32 }}>
        <h3 style={{ color: '#1976d2', fontWeight: 600, marginBottom: 8 }}>Temperature, Humidity, and Rainfall Trends</h3>
        <ResponsiveContainer width="100%" height={220}>
          <LineChart data={data} margin={{ top: 16, right: 24, left: 0, bottom: 0 }}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="recorded_at" tickFormatter={str => str.slice(11, 16)} minTickGap={20} />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="temperature" stroke="#ffa726" dot={false} name="Temperature" />
            <Line type="monotone" dataKey="humidity" stroke="#1976d2" dot={false} name="Humidity" />
            <Line type="monotone" dataKey="rainfall" stroke="#388e3c" dot={false} name="Rainfall" />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}

export default WeatherForecastPanel;
